sys_variable_value.value:
(function execute(inputs, outputs) {

var appName = inputs.string;

var sp = inputs.split;

var partsArray = appName.split(sp);

outputs.parts1 = partsArray[0];
outputs.parts2 = partsArray[1];
outputs.parts3 = partsArray[2];
outputs.parts4 = partsArray[3];

})(inputs, outputs);

